        <div className={styles.TrackContainer}>
            <span className={styles.Track}>
                {props.trackData.name} by {props.trackData.artists[0].name} 
            </span>
            <button className={styles.RemoveButton} onClick={handleClick}>+</button>
        </div>
    )
}

export default Track;
